contracts/voting.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.30;

/**
 * @title Voting
 * @dev Um contrato inteligente para um sistema de votação transparente.
 * Permite que o proprietário do contrato gerencie candidatos e o período de votação.
 * Cada endereço só pode votar uma vez.
 */
contract Voting {
    // Endereço do administrador que gerencia a votação
    address public owner;

    // Estrutura para representar um candidato
    struct Candidate {
        uint id;
        string name;
        uint voteCount;
    }

    // Mapeamento do ID do candidato para a sua estrutura
    mapping(uint => Candidate) public candidates;
    // Contador para gerar IDs únicos para os candidatos
    uint public candidatesCount;

    // Mapeamento para rastrear quais endereços já votaram
    mapping(address => bool) public voters;

    // Enum para representar os estados da votação
    enum VotingState { NotStarted, Open, Closed }
    // Variável que armazena o estado atual da votação
    VotingState public votingState;

    // Evento emitido quando um novo voto é registrado
    event Voted(uint indexed candidateId, address indexed voter);
    // Evento emitido quando o estado da votação muda
    event VotingStateChanged(VotingState newState);

    /**
     * @dev Modificador para restringir funções apenas ao proprietário do contrato.
     */
    modifier onlyOwner() {
        require(msg.sender == owner, "Apenas o proprietario pode chamar esta funcao.");
        _;
    }

    /**
     * @dev Modificador para permitir ações apenas quando a votação está aberta.
     */
    modifier votingIsOpen() {
        require(votingState == VotingState.Open, "A votacao nao esta aberta.");
        _;
    }

    /**
     * @dev O construtor define o proprietário do contrato e o estado inicial da votação.
     */
    constructor() {
        owner = msg.sender;
        votingState = VotingState.NotStarted;
    }

    /**
     * @dev Adiciona um novo candidato à votação.
     * @param _name O nome do candidato.
     * Apenas o proprietário pode adicionar candidatos e apenas antes do início da votação.
     */
    function addCandidate(string memory _name) public onlyOwner {
        require(votingState == VotingState.NotStarted, "A votacao ja comecou ou terminou.");
        candidatesCount++;
        candidates[candidatesCount] = Candidate(candidatesCount, _name, 0);
    }

    /**
     * @dev Inicia o período de votação.
     * Apenas o proprietário pode iniciar a votação.
     */
    function startVoting() public onlyOwner {
        require(votingState == VotingState.NotStarted, "A votacao ja foi iniciada.");
        votingState = VotingState.Open;
        emit VotingStateChanged(VotingState.Open);
    }

    /**
     * @dev Encerra o período de votação.
     * Apenas o proprietário pode encerrar a votação.
     */
    function endVoting() public onlyOwner {
        require(votingState == VotingState.Open, "A votacao nao esta aberta para ser encerrada.");
        votingState = VotingState.Closed;
        emit VotingStateChanged(VotingState.Closed);
    }

    /**
     * @dev Permite que um eleitor registre seu voto para um candidato.
     * @param _candidateId O ID do candidato para o qual votar.
     * A votação deve estar aberta e o eleitor não pode ter votado antes.
     */
    function vote(uint _candidateId) public votingIsOpen {
        // Verifica se o eleitor já votou
        require(!voters[msg.sender], "Voce ja votou.");
        // Verifica se o ID do candidato é válido
        require(_candidateId > 0 && _candidateId <= candidatesCount, "Candidato invalido.");

        // Incrementa o contador de votos do candidato
        candidates[_candidateId].voteCount++;
        // Marca o eleitor como já tendo votado
        voters[msg.sender] = true;

        // Emite o evento de voto
        emit Voted(_candidateId, msg.sender);
    }

    /**
     * @dev Retorna uma lista de todos os candidatos e seus votos.
     * @return Uma lista de estruturas de Candidatos.
     * Esta função é do tipo 'view', portanto não gasta gás para ser chamada.
     */
    function getAllCandidates() public view returns (Candidate[] memory) {
        Candidate[] memory allCandidates = new Candidate[](candidatesCount);
        for (uint i = 1; i <= candidatesCount; i++) {
            allCandidates[i-1] = candidates[i];
        }
        return allCandidates;
    }

    /**
     * @dev Verifica se um endereço específico já votou.
     * @param _voter O endereço a ser verificado.
     * @return true se o endereço já votou, false caso contrário.
     */
    function getVoterStatus(address _voter) public view returns (bool) {
        return voters[_voter];
    }
}

