documentation.text:
@title Voting
@dev Um contrato inteligente para um sistema de votação transparente.
Permite que o proprietário do contrato gerencie candidatos e o período de votação.
Cada endereço só pode votar uma vez.

@dev Adiciona um novo candidato à votação.
@param _name O nome do candidato.
Apenas o proprietário pode adicionar candidatos e apenas antes do início da votação.

@dev Permite que um eleitor registre seu voto para um candidato.
@param _candidateId O ID do candidato para o qual votar.
A votação deve estar aberta e o eleitor não pode ter votado antes.

@dev Retorna uma lista de todos os candidatos e seus votos.
@return Uma lista de estruturas de Candidatos.
Esta função é do tipo 'view', portanto não gasta gás para ser chamada.

@dev Verifica se um endereço específico já votou.
@param _voter O endereço a ser verificado.
@return true se o endereço já votou, false caso contrário.
